import React, { useState } from 'react';

const App = () =>{

    let date = new Date().toLocaleTimeString(); 
    const state = useState()
    const [time, setValue] = useState(date)

    const data = () => {
        setValue(time)
    }

    return(
        <>
            <h1>{time}</h1>
            <button onClick={data}>Get Time</button>
        </>
    )
}

export default App;
